import { Link } from "react-router"
import './App.css';

function App() {
  return (
    <div className="App">
     <h1>Testing</h1>
     <Router>
     <Route Route path="/home" exact render={props => (

        <h1>Home</h1>


    )} />

    <Route Route path="/home" exact render={props => (

        <h1>About</h1>


    )} />

    <Route Route path="/home" exact render={props => (

        <h1>Contact</h1>


    )} />
     </Router>
    </div>
  );
}

export default App;
